 const UserProfile = () => {
  const router = useRouter();

  const [search, setSearch] = useState("");

  const filteredBooks = useMemo(() => {
    return books.filter(book =>
      book.title.toLowerCase().includes(search.toLowerCase())
    );
  }, [search]);

  return (
    <View style={styles.container}>
      <View >
        <TouchableOpacity style={styles.header} onPress={() => router.push('/perfil')} >
          <Image source={{ uri: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSZWU2rz5ntKtK2A2Sv21EIopsyhlXMSA8YAg&s' }} style={styles.profilePic} />
          <Text style={styles.greeting}>Oi, Clara!</Text>
        </TouchableOpacity>
      </View>

      <TextInput
        style={styles.searchInput}
        placeholder="Buscar livros"
        placeholderTextColor="#C194B7"
        value={search}
        onChangeText={setSearch}
      />

      <FlatList
        data={filteredBooks}
        keyExtractor={item => item.id}
        numColumns={2}
        contentContainerStyle={styles.booksList}
        renderItem={({ item }) => (
          <View style={styles.bookItem}>
            <Image source={{ uri: item.image }} style={styles.bookCover} />
            <Text style={styles.bookTitle}>{item.title}</Text>
          </View>
        )}
      />
    </View>
  );
};

